def equals(self, other):
    self_axes, other_axes = self.axes, other.axes
    if len(self_axes) != len(other_axes) or not all(ax1.equals(ax2) for ax1, ax2 in zip(self_axes, other_axes)):
        return False

    self._consolidate_inplace()
    other._consolidate_inplace()
    if len(self.blocks) != len(other.blocks):
        return False

    self_key = [(block.values.dtype.name, block.values.tobytes() if isinstance(block.values, np.ndarray) else block.values) for block in self.blocks]
    other_key = [(block.values.dtype.name, block.values.tobytes() if isinstance(block.values, np.ndarray) else block.values) for block in other.blocks]

    self_blocks = [block for _, block in sorted(zip(self_key, self.blocks))]
    other_blocks = [block for _, block in sorted(zip(other_key, other.blocks))]

    return all(
        block.equals(oblock) for block, oblock in zip(self_blocks, other_blocks)
    )
